// Home.js
import React from 'react';
import Header from '../../components/header/Header';
import Footer from '../../components/footer/Footer';
import Background from '../../components/background/Background';
import './Home.scss';

import leftBackgroundImage from '../../images/home/backgroundLeft.png';
import rightBackgroundImage from '../../images/home/backgroundRight.png';
import mainBackgroundImage from '../../images/home/background.png';

const Home = () => {
  return (
    <Background
      leftBackgroundImage={leftBackgroundImage}
      rightBackgroundImage={rightBackgroundImage}
      mainBackgroundImage={mainBackgroundImage}
    >
      <Header />
      <h1>Home</h1>
      <div className='leftContentHome'>
        <div className='leftContentIconHome'>
          <i class="fa-solid fa-house"></i>
          <i class="fa-solid fa-bug-slash"></i>
          <i class="fa-solid fa-fire-flame-curved"></i>
          <i class="fa-solid fa-bug-slash"></i>
          <i class="fa-solid fa-fire-flame-curved"></i>
        </div>
        <div className='button-playHome'>
          <i class="fa-solid fa-circle-play"></i>
        </div>
      </div>
      <Footer />
    </Background>
  );
};

export default Home;
